import React from 'react';

const Footer = () => {
    return (
        <footer>
            <p>&copy; {new Date().getFullYear()} Туристична платформа</p>
            <p>Телефон: +380679697065</p>
            <p>Пошта: anastasiabelikova39@gmail.com</p>
        </footer>
    );
};

export default Footer;
